Very HQ rare promo music video. &quot;No Ordinary Love&quot; is the lead single from the English artist Sade's fourth studio album, Love Deluxe (1992). Released in 1992 on Epic Records, it was a mid-charting hit in the UK when originally released, but reached number fourteen when re-released in 1993.

The song won a Grammy Award for Best R&amp;B Performance by a Duo or Group with Vocals in 1994.

&quot;No Ordinary Love&quot; was featured prominently in the 1993 film Indecent Proposal, though it was not included on the film's soundtrack album.

&quot;No Ordinary Love&quot; is often considered Sade's signature song, alongside 1988's &quot;Paradise&quot; and 1985's &quot;Smooth Operator.&quot;

Sade are an English R&amp;B band that formed in 1983. The band's music features elements of R&amp;B, soul, jazz, funk and soft rock. The band is named after their British Nigerian lead vocalist, Sade Adu.

Sade's debut album, Diamond Life, went Top Ten in the U.K. in late 1984 and sold platinum. In 1986, Sade won a Grammy for Best New Artist. Sade's US certified sales so far stands at 23.5 million units according to RIAA, and has sold more than 57 million units worldwide to date.
